public class InnerDataSourceCustomDocumentEnrichmentConfigurationFactory(Action<Humidifier.Kendra.DataSourceTypes.CustomDocumentEnrichmentConfiguration> factoryAction = null) : SubResourceFactory<Humidifier.Kendra.DataSourceTypes.CustomDocumentEnrichmentConfiguration>
{

    internal InnerDataSourceHookConfigurationFactory PreExtractionHookConfigurationFactory { get; set; }

    internal InnerDataSourceHookConfigurationFactory PostExtractionHookConfigurationFactory { get; set; }

    protected override Humidifier.Kendra.DataSourceTypes.CustomDocumentEnrichmentConfiguration Create()
    {
        var customDocumentEnrichmentConfigurationResult = CreateCustomDocumentEnrichmentConfiguration();
        factoryAction?.Invoke(customDocumentEnrichmentConfigurationResult);

        return customDocumentEnrichmentConfigurationResult;
    }

    private Humidifier.Kendra.DataSourceTypes.CustomDocumentEnrichmentConfiguration CreateCustomDocumentEnrichmentConfiguration()
    {
        var customDocumentEnrichmentConfigurationResult = new Humidifier.Kendra.DataSourceTypes.CustomDocumentEnrichmentConfiguration();

        return customDocumentEnrichmentConfigurationResult;
    }
    public override void CreateChildren(Humidifier.Kendra.DataSourceTypes.CustomDocumentEnrichmentConfiguration result)
    {
        base.CreateChildren(result);

        result.PreExtractionHookConfiguration ??= PreExtractionHookConfigurationFactory?.Build();
        result.PostExtractionHookConfiguration ??= PostExtractionHookConfigurationFactory?.Build();
    }

} // End Of Class

